sanityChecks.promptOutput:
{
  "hasMaterialIssues": true,
  "overallAssessment": "The tables largely describe a coherent inventory and order management domain, but several material problems exist: ambiguous primary key definition for purchase orders, contradictory pricing description on PO lines, inconsistent status code conventions, and missing critical foreign‑key context for many inventory‑related tables.",
  "tableIssues": [
    {
      "tableName": "PurchaseOrderHeader",
      "issueType": "relationship_inconsistency",
      "severity": "high",
      "description": "The description says po_id is a \"Unique identifier for the purchase order (primary key component)\" and also lists sup_id as a primary key component, implying a composite key, which conflicts with typical design where po_id alone is the primary key and sup_id is a foreign key.",
      "affectedTables": ["PurchaseOrderHeader", "PurchaseOrderLine", "Supplier"],
      "suggestedFix": "Clarify that po_id is the sole primary key and sup_id is a foreign key referencing Supplier.sup_id."
    },
    {
      "tableName": "PurchaseOrderLine",
      "issueType": "business_logic",
      "severity": "high",
      "description": "Column prc is described as \"Unit price of the product for this line (or line total if multiplied by qty)\", which is contradictory – a column cannot simultaneously store a unit price and a line total.",
      "affectedTables": ["PurchaseOrderLine", "Product", "PurchaseOrderHeader"],
      "suggestedFix": "Define prc strictly as the unit price; if a line total is needed, add a separate computed column (e.g., line_total = qty * prc)."
    },
    {
      "tableName": "Return",
      "issueType": "terminology",
      "severity": "medium",
      "description": "The sts column uses full word statuses (Approved, Rejected, etc.) while most other tables use single‑character codes for status, creating inconsistency in status representation across the schema.",
      "affectedTables": ["Return", "PurchaseOrderHeader", "OrderHeader", "Shipment"],
      "suggestedFix": "Adopt a consistent single‑character status code scheme (e.g., A=Approved, R=Rejected, P=Pending, C=Completed) for the Return table."
    },
    {
      "tableName": "InventoryAdjustment",
      "issueType": "missing_context",
