      "affectedTables": ["InventoryAdjustment", "Product", "Warehouse"],
      "suggestedFix": "Add explicit foreign‑key notes: prd_id → Product.prd_id, whs_id → Warehouse.whs_id."
    },
    {
      "tableName": "InventoryCount",
      "issueType": "missing_context",
